Ключевые навыки:
- Понимание Java Core;
- Понимание REST.
- Spring boot, spring data, spring security.
- Понимание внутренностей spring: жизненный цикл бина, цикл spring boot, обновление prototype в singleton;
- Понимание реляционных баз данных и языка SQL;
- Отличное знание алгоритмов и структур данных: массивы, стэки, пирамиды, очереди, красно-черные деревья, В-деревья, хэштаблицы, графы и тд. Алогоритмы вставки, удаления и поиска в структурах данных так же различные алгоритмы сортировки от O(n) до медленных O(n^2);
- Знание систем автоматической сборки: maven;
- Опыт работы с git;
- Опыт работы с JSF, Hessian
- Дипломная работа: распределенная система "железнодорожная касса" была выполнена на C# с использованием технологии RabbitMQ, а так же с использованием микросервисной архитектуры.

Так же параллельно веду собственный коммерческий проект с использованием таких технологий: Spring Boot REST, Postgres, Android

